// src/pages/LoginPaciente.js

import React, { useState } from 'react';
import { Container, Button, Form } from 'react-bootstrap';
import '../styles/LoginPaciente.css'; // Importando o CSS específico
import { addMedico } from '../services/medicoService'; // Importando o serviço

const LoginMedico = () => {
  const [isLogin, setIsLogin] = useState(true); // Estado para alternar entre Login e Cadastro
  const [medicoData, setMedicoData] = useState({
    name: '',
    especialidade: '',
    crm: '',
    contact: '',
  });
  const [error, setError] = useState(''); // Para exibir erros
  const [successMessage, setSuccessMessage] = useState(''); // Para exibir mensagens de sucesso

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setMedicoData({ ...medicoData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log('Dados do médico:', medicoData); // Adicione este log
    try {
      await addMedico(medicoData);
      setSuccessMessage('Médico cadastrado com sucesso!'); // Mensagem de sucesso
      setMedicoData({ name: '', especialidade: '', crm: '', contact: '' }); // Limpa os campos após cadastro
      setError(''); // Limpa o erro, se houver
    } catch (err) {
      console.error('Erro ao cadastrar médico:', err); // Use console.error para erros
      const errorMessage = err.response?.data?.message || err.message || 'Erro desconhecido'; // Extraindo a mensagem de erro
      setError('Erro ao cadastrar médico: ' + errorMessage); // Atualiza a mensagem de erro
    }
  };

  return (
    <Container className="d-flex align-items-center justify-content-center vh-100">
      <div className={`container ${isLogin ? '' : 'active'}`} id="container">
        {/* Formulário de Cadastro */}
        <div className="form-container sign-up">
          <Form onSubmit={handleSubmit}>
            <h1>Criar Conta</h1>
            <Form.Group controlId="formNome">
              <Form.Control
                type="text"
                name="name"
                placeholder="Nome"
                value={medicoData.name}
                onChange={handleInputChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formEspecialidade">
              <Form.Control
                type="text"
                name="especialidade"
                placeholder="Especialidade"
                value={medicoData.especialidade}
                onChange={handleInputChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formCrm">
              <Form.Control
                type="text"
                name="crm"
                placeholder="CRM (ex: 123456/CE)"
                pattern="^[0-9]{6}/[A-Za-z]{2}$"
                title="CRM deve seguir o formato 123456/XX"
                value={medicoData.crm}
                onChange={handleInputChange}
                required
              />
            </Form.Group>
            <Form.Group controlId="formTelefone">
              <Form.Control
                type="tel"
                name="contact"
                placeholder="Telefone"
                value={medicoData.contact}
                onChange={handleInputChange}
                required
              />
            </Form.Group>
            <Button variant="primary" type="submit">
              Criar Conta
            </Button>
            {successMessage && <p style={{ color: 'green' }}>{successMessage}</p>} {/* Exibe mensagem de sucesso */}
            {error && <p style={{ color: 'red' }}>{error}</p>} {/* Exibe erro se existir */}
          </Form>
        </div>

        {/* Formulário de Login */}
        <div className="form-container sign-in">
          <Form>
            <h1>Entrar</h1>
            <Form.Group controlId="formCRM">
              <Form.Control type="text" placeholder="CRM" />
            </Form.Group>
            <Form.Group controlId="formSenha">
              <Form.Control type="password" placeholder="Senha" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Entrar
            </Button>
          </Form>
          <p>
            Não possui uma conta?{' '}
            <Button variant="link" onClick={() => setIsLogin(false)}>Cadastre-se</Button>
          </p>
        </div>

        {/* Toggle */}
        <div className="toggle-container">
          <div className="toggle">
            <div className="toggle-panel toggle-left">
              <h1>Bem-vindo de Volta Dr(a)!</h1>
              <p>Insira seus dados pessoais para acessar todas as funcionalidades.</p>
              <Button className="hidden" onClick={() => setIsLogin(true)}>Entrar</Button>
            </div>
            <div className="toggle-panel toggle-right">
              <h1>Olá, Dr(a)!</h1>
              <p>Cadastre-se com seus dados pessoais para acessar todas as funcionalidades do Health Horizon</p>
              <Button className="hidden" onClick={() => setIsLogin(false)}>Criar Conta</Button>
            </div>
          </div>
        </div>
      </div>
    </Container>
  );
};

export default LoginMedico;
